import React from 'react';

import 'antd/dist/antd.css';
import './App.css';

import { Router, Route, Switch, Link } from 'react-router-dom' 
import OARBeliAdd from './components/OARBeliAdd.jsx';

function App() {
  const App = () => {
    return (
    <div className="App">
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to='/OARBeli/add'>Add OARBeli</Link>
              </li>
            </ul>
          </nav>
        </div>

        <Switch>
          <Route path='/OARBeli/add'>
            <OARBeliAdd />
          </Route>
        </Switch>
      </Router>
    </div>
    );
  }

  return (
      <App />
  );
}


export default App;
